import {TodoItem} from './TodoItem'

import {ITodo} from '../types/data'
interface ITodoListProps{
    items: ITodo[];
}
const TodoList: React.FC<ITodoListProps> = (props) => {
    return <div>
        {
            props.items.map(el => <TodoItem key={key.id} {...el}/>)
        }
        </div>
}

export {
    TodoList
}
